import React from "react"

const TodoItemShow = props => {


    const deleteHandler = () => {
        props.onDelete(props.id)
    }

    return (
        <li >
            {props.children}
            <button onClick={deleteHandler}/>
        </li>
    )
}

export default TodoItemShow;
